備蓄用の非常食として長期間の保存ができる包装米飯です。<img src="http://image.rakuten.co.jp/cocodecow/cabinet/zaikocall.gif" width="303" height="100" border="0"><br />アルミ外装袋の中には、ごはん（２００ｇ）が６パック入っています。電子レンジ又は熱湯で加熱してお召し上がりください。酸味料、保存料、化学調味料は使用しておりません。<BR>●内容量：２００ｇ×６パック●原材料：うるち米（国内産）●賞味期限：製造日より５年<BR>●栄養成分表示（１食２００ｇあたり）：エネルギー／２８６ｋｃａｌ、たんぱく質／３．８ｇ、脂質／０．７ｇ、炭水化物／６６．１ｇ、ナトリウム／９ｍｇ<BR>※メーカーの都合により、パッケージ・仕様等は予告なく変更になる場合がございます。<BR><BR><BR><BR><BR>ご飯　ゴハン　１袋　１包　６パック　６個　６食　６膳　非常食　災害時食料　避難用　アルミパック　防犯・防災用品　備蓄・常備品<style type="text/css">
